--
-- Create procedure `Proc_Employee_GetSearchPaging`
--
CREATE DEFINER = 'root'@'localhost'
PROCEDURE Proc_Employee_GetSearchPaging (IN `@Keyword` varchar(100), -- Từ khóa để tìm kiếm theo tên, số điện thoại hoặc email
IN `@Offet` int, -- Số thứ tự bản ghi bắt đầu của trang tương ứng (tính từ 0)
IN `@Limit` int -- Số bản ghi trên một trang
)
COMMENT '-- Author:        KhaiND
  -- Created date:  20/11/2022
  -- Description:   Tìm kiếm Cán bộ, giáo viên theo tên, số điện thoại, email và phân trang
  -- Modified by:
  -- Code chạy thử: CALL `misaqlth_w092022`.Proc_;'
BEGIN

  IF (IFNULL(`@Offet`, '') = '')
    OR `@Offet` < 0 THEN
    SET `@Offet` = 0;
  END IF;

  IF IFNULL(`@Keyword`, '') = '' THEN
    SET `@Keyword` = '';
  END IF;

  IF `@Limit` = -1 THEN
    SET @searchQuery = CONCAT('SELECT e.EmployeeID, e.EmployeeCode, e.EmployeeName, e.EmployeePhoneNumber, e.EmployeeEmail, e.DepartmentID, d.DepartmentName, e.EmployeeIsDeviceManager, e.EmployeeWorkingStatus FROM employee e LEFT JOIN department d ON e.departmentID = d.departmentID WHERE e.EmployeeName LIKE \'%', `@Keyword`, '%\' OR e.EmployeePhoneNumber LIKE \'%', `@Keyword`, '%\' OR e.EmployeeEmail LIKE \'%', `@Keyword`, '%\' ORDER BY e.CreatedDate DESC');
  ELSE
    SET @searchQuery = CONCAT('SELECT e.EmployeeID, e.EmployeeCode, e.EmployeeName, e.EmployeePhoneNumber, e.EmployeeEmail, e.DepartmentID, d.DepartmentName, e.EmployeeIsDeviceManager, e.EmployeeWorkingStatus FROM employee e LEFT JOIN department d ON e.departmentID = d.departmentID WHERE e.EmployeeName LIKE \'%', `@Keyword`, '%\' OR e.EmployeePhoneNumber LIKE \'%', `@Keyword`, '%\' OR e.EmployeeEmail LIKE \'%', `@Keyword`, '%\' ORDER BY e.CreatedDate DESC LIMIT ', `@Limit`, ' OFFSET ', `@Offet`);
  END IF;

  PREPARE searchQuery FROM @searchQuery;
  EXECUTE searchQuery;
  DEALLOCATE PREPARE searchQuery;

  SET @totalRecord = CONCAT('SELECT COUNT(*) AS \'TotalRecord\' FROM employee e WHERE e.EmployeeName LIKE \'%', `@Keyword`, '%\' OR e.EmployeePhoneNumber LIKE \'%', `@Keyword`, '%\' OR e.EmployeeEmail LIKE \'%', `@Keyword`, '%\'');

  PREPARE countQuery FROM @totalRecord;
  EXECUTE countQuery;
  DEALLOCATE PREPARE countQuery;

END
$$

